import React from 'react';

const Spinner = () => {
    return (
        <React.Fragment>
            <div className="fontify display-3 text-center mt-4">Loading</div>
            <div className="ui  large  active centered inline loader"></div>
        </React.Fragment>
    );
};

export default Spinner;
